        "# **# BLOCK 3: DATENVORBEREITUNG (Preprocessing & Normalisierung)**\n",
        "\n",
        "THEORIE ZUR NORMALISIERUNG:\n",
        "Die Rohdaten haben Pixelwerte von 0 bis 255. Für neuronale Netze ist dies problematisch,\n",
        "da große Eingabewerte zu großen Gewichtsänderungen führen können, was das Training instabil macht.\n",
        "Wir skalieren die Daten auf den Bereich [0, 1]. Dies ist entscheidend für die Effizienz\n",
        "des Optimizers (Adam), um die Schrittweite (Lernrate α) korrekt anzupassen\n",
        "(vgl. Vorlesungsnotizen zu Lernrate und Konvergenz)."
