        "# VISUALISIERUNG 3: Lernkurven (Accuracy & Loss)\n",
        "# Hier prüfen wir auf Overfitting.\n",
        "def plot_history(histories, titles):\n",
        "    fig, axes = plt.subplots(2, 2, figsize=(15, 10))\n",
        "    metrics = ['accuracy', 'loss']\n",
        "\n",
        "    for i, (history, title) in enumerate(zip(histories, titles)):\n",
        "        for j, metric in enumerate(metrics):\n",
        "            ax = axes[j, i]\n",
        "            ax.plot(history.history[metric], label=f'Train {metric.capitalize()}', linewidth=2)\n",
        "            ax.plot(history.history[f'val_{metric}'], label=f'Val {metric.capitalize()}', linestyle='--')\n",
        "            ax.set_title(f\"{title} - {metric.capitalize()}\")\n",
        "            ax.set_xlabel('Epoche')\n",
        "            ax.set_ylabel(metric.capitalize())\n",
        "            ax.legend()\n",
        "            ax.grid(True)\n",
        "\n",
        "    plt.tight_layout()\n",
        "    plt.show()\n",
        "\n",
        "plot_history([history_nn, history_dnn], [\"Simple NN\", \"Deep NN\"])\n",
        "print(\"Visualisierung 3 abgeschlossen: Die Lernkurven zeigen den Trainingsfortschritt. Ein Auseinanderdriften von Train und Val deutet auf Overfitting hin.\")\n",
